import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import Layout from "./components/PageLayout.js";

// Google Books API key
const GOOGLE_BOOKS_API = "AIzaSyAbLk6ES7BqijZOLID2YDlKtCcLaQKKt1c";

//Practice Code
const container = document.getElementById("root");
const root = ReactDOM.createRoot(container);

async function GetDataJson(subject) {
  const response = await fetch(
    "https://www.googleapis.com/books/v1/volumes?q=subject:" + subject
  );

  return response.json();
}

var some;
GetDataJson("Fiction").then((val) => {
  some = val.totalItems.toString();
});



root.render(<Layout some={some} />);
